import { useParams } from 'react-router-dom'
import getDetalhesPost from '../../../utils/getDetalhesPost'

const PaginaPost = () => {

    const { id } = useParams()

    useEffect(() => {
        getDetalhesPost()
    },[])

    return (
        <>
            <h3>TESTE: PAGINA DO POST</h3>
            <h4>ID: {id}</h4>
        </>
    )
}

export default PaginaPost
